import React from 'react';

function App() {
  const buttonStyle = {
    background: 'white',
    border: 'none',
    borderRadius: '5px',
    color: 'black',
    fontSize: '18px',
    padding: '10px 20px',
    margin: '10px',
    cursor: 'pointer'
  };

  const logoStyle = {
    width: '50px',
    height: '50px',
    margin: '10px'
  };

  const loginButtonStyle = {
    background: 'black',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    padding: '10px 20px',
    position: 'absolute',
    top: '10px',
    right: '10px',
    cursor: 'pointer'
  };

  return (
    <div style={{ backgroundColor: 'black', height: '100vh', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
      <button style={loginButtonStyle}>Login</button>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <img src="code-editor-logo.png" alt="Code Editor Logo" style={logoStyle} />
        <button style={buttonStyle}>Code Editor</button>
      </div>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <img src="portfolio-logo.png" alt="Portfolio Logo" style={logoStyle} />
        <button style={buttonStyle}>Portfolio</button>
      </div>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <img src="strategy-logo.png" alt="Strategy Management Logo" style={logoStyle} />
        <button style={buttonStyle}>Strategy Management</button>
      </div>
    </div>
  );
}

export default App;
